Add-PSSnapin Citrix*

#region Controller

Get-BrokerController | select DNSName,ControllerVersion,State,DesktopsRegistered 

#endregion Controller

#region Worker

# Auslesen von Maschinen und Setzen des Wartungsmodus
Get-BrokerMachine | Select-Object DNSName,CatalogName,DesktopGroupName,RegistrationState,InMaintenanceMode,SessionCount | Format-Table
Get-BrokerMachine | Where-Object {$_.DesktopGroupName -eq 'DCUG Desktop Group 2'} | Set-BrokerMachine -InMaintenanceMode $true

# Aktion auf bestimmten Maschinen
Get-BrokerMachine | Where-Object {$_.DNSName -like 'vda-0*'} | ForEach-Object {
    [pscustomobject]@{
        ComputerName = $_.DNSName
        ListOfDDCs = Invoke-Command -ComputerName $_.DNSName -ScriptBlock {
            Get-ItemProperty -Path HKLM:\SOFTWARE\Policies\Citrix\VirtualDesktopAgent -Name ListOfDDCs | Select-Object -ExpandProperty ListOfDDCs
        }
    }
}

# Entfernen einer Maschine aus einer Desktopgruppe
Get-BrokerMachine | Where-Object {$_.DNSName -like 'vda-02.*'} | Remove-BrokerMachine -DesktopGroup 'DCUG Desktop Group 2'

# Anlegen und Konfigurieren einer Desktopgruppe
$NewGroup = New-BrokerDesktopGroup -DeliveryType "DesktopsAndApps" -DesktopKind "Shared" -Name "DCUG Desktop Group 2" -PublishedName "DCUG Desktop Group 2" -SessionSupport "MultiSession"
Add-BrokerMachinesToDesktopGroup -Catalog "DCUG Catalog" -Count 1 -DesktopGroup $NewGroup.Name
New-BrokerEntitlementPolicyRule -DesktopGroupUid $NewGroup.Uid -IncludedUserFilterEnabled $False -Name "DCUG Desktop Group 2"
New-BrokerAppEntitlementPolicyRule -DesktopGroupUid $NewGroup.Uid -IncludedUserFilterEnabled $False -Name "DCUG Desktop Group 2"
New-BrokerAccessPolicyRule -AllowedConnections NotViaAG -AllowedProtocols @("HDX","RDP") -AllowedUsers "Filtered" -AllowRestart $True -DesktopGroupUid $NewGroup.Uid -Enabled $True -IncludedSmartAccessFilterEnabled $True -IncludedUserFilterEnabled $True -IncludedUsers @("DEMO\Domain Users") -Name "DCUG Desktop Group 2_Direct"
New-BrokerAccessPolicyRule -AllowedConnections ViaAG -AllowedProtocols @("HDX","RDP") -AllowedUsers "Filtered" -AllowRestart $True -DesktopGroupUid $NewGroup.Uid -Enabled $True -IncludedSmartAccessFilterEnabled $True -IncludedSmartAccessTags @() -IncludedUserFilterEnabled $True -IncludedUsers @("DEMO\Domain Users") -Name "DCUG Desktop Group 2_AG"

#endregion Worker

#region Administratoren

# Neuer Scope für DCUG Desktop Group
$NewScope = New-AdminScope -Name "DCUG"
Add-BrokerScope -DesktopGroup "DCUG Desktop Group 2" -InputObject @($NewScope.Name)

# Anlegen des Administrators und Zuweisen von Scope und Rolle
New-AdminAdministrator -Name "DEMO\ndille-admin" -Enabled $True
Add-AdminRight -Administrator "DEMO\ndille-admin" -Role "Help Desk Administrator" -Scope $NewScope.Name

#endregion Administratoren

#region Veröffentlichungen

# Auslesen der passenden Desktopgruppe
$DesktopGroup = Get-BrokerDesktopGroup -Name 'DCUG Desktop Group'

# Veröffentlichung von cmd.exe
$IconCmd = New-BrokerIcon -EncodedIconData ""
New-BrokerApplication -Name "Command Prompt" -ApplicationType "HostedOnDesktop" -CommandLineExecutable "C:\Windows\system32\cmd.exe" -DesktopGroup $DesktopGroup.Uid -Enabled $True -IconUid $IconCmd.Uid -Priority 0 -PublishedName "Command Prompt" -SecureCmdLineArgumentsEnabled $True -UserFilterEnabled $False -Visible $True -WaitForPrinterCreation $False

# Veröffentlichung von ServerManager.exe
$IconSrvMan = New-BrokerIcon -EncodedIconData ""
New-BrokerApplication -Name "Server Manager" -ApplicationType "HostedOnDesktop" -CommandLineExecutable "C:\Windows\system32\ServerManager.exe" -DesktopGroup $DesktopGroup.Uid -Enabled $True -IconUid $IconSrvMan.Uid -Priority 0 -PublishedName "Server Manager" -SecureCmdLineArgumentsEnabled $True -UserFilterEnabled $False -Visible $True -WaitForPrinterCreation $False

# Veröffentlichung von PowerShell.exe
$IconPs = New-BrokerIcon -EncodedIconData ""
New-BrokerApplication -Name "Windows PowerShell" -ApplicationType "HostedOnDesktop" -CommandLineExecutable "C:\Windows\System32\WindowsPowerShell\v1.0\powershell.exe" -DesktopGroup $DesktopGroup.Uid -Enabled $True -IconUid $IconPs.Uid -Priority 0 -PublishedName "Windows PowerShell" -SecureCmdLineArgumentsEnabled $True -UserFilterEnabled $False -Visible $True -WaitForPrinterCreation $False

#endregion Veröffentlichungen

#region Sitzungen

# Ausgabe von Sitzungen
Get-BrokerSession | Select-Object UserName,DesktopGroupName,DNSName,InMaintenanceMode,Protocol,SessionState | Format-Table

# Beispiele für Sitzungsauswahl
Get-BrokerSession -ApplicationInUse ‘Word 2016‘
Get-BrokerSession -UserName DEMO\ndille
Get-BrokerSession -DesktopGroupName DCUG_Test
Get-BrokerSession -InMaintenanceMode $true
Get-BrokerSession -SessionState Disconnected
Get-BrokerSession -SessionSupport MultiSession

# Trennen von Sitzungen
Get-BrokerSession | Disconnect-BrokerSession

# Benachrichtigen von Sitzungen
Get-BrokerSession | Send-BrokerSessionMessage -MessageStyle Exclamation -Title 'Server wird in Kürze neu gestartet' -Text 'Bitte speichern Sie alle Daten. Ihre Sitzung wird in 5 Minuten beendet.'

# Abmelden von Sitzungen
Get-BrokerSession | Stop-BrokerSession

#endregion Sitzungen

#region Anlegen eines Maschinenkatalogs

# Erstellen des Katalogs
$NewBrokerCatalog = New-BrokerCatalog -Name $Name -Description $Description -AllocationType $AllocationType -ProvisioningType $ProvisioningType -PersistUserChanges $PersistUserChanges -SessionSupport $SessionSupport -MachinesArePhysical $MachinesArePhysical -Verbose:$False
# Erstellen des Namensschemas für die AD-Mitgliedschaft
$NewAcctIdentityPool = New-AcctIdentityPool -Domain $Domain -IdentityPoolName $Name -NamingScheme $NamingScheme -NamingSchemeType $NamingSchemeType -OU $OU -Verbose:$False
# Setzen einer GUID für den Katalog
Set-BrokerCatalogMetadata -CatalogId $NewBrokerCatalog.Uid -Name 'Citrix_DesktopStudio_IdentityPoolUid' -Value ([guid]::NewGuid()) -Verbose:$False
# Anlegen des Provisionierungsschemas als Hintergrund-Task
$NewProvTaskId = New-ProvScheme -ProvisioningSchemeName $Name -HostingUnitName $HostingUnitName -IdentityPoolName $Name -MasterImageVM $MasterImageVM -VMCpuCount $CpuCount -VMMemoryMB $MemoryMB -CleanOnBoot:$CleanOnBoot -Verbose:$False -RunAsynchronously
<# Warten auf Beendigung des Provisionierungs-Tasks #>
# Verknüpfen des Provisionierungsschemas mit dem Katalog
Set-BrokerCatalog -Name $Name -ProvisioningSchemeId $NewProvScheme.ProvisioningSchemeUid -Verbose:$False
# Setzen der zuständigen Controller für das Provisionierungsschema
$Controllers = Get-BrokerController -Verbose:$False | Select-Object -ExpandProperty DNSName -Verbose:$False
Add-ProvSchemeControllerAddress -ProvisioningSchemeName $Name -ControllerAddress $Controllers -Verbose:$False

#endregion Anlegen eines Maschinenkatalogs

#region Anlegen einer Hosting-Verbindung

function New-HostingConnection {
    <#
    .SYNOPSIS
    Create a new hosting connection
    .DESCRIPTION
    This function only creates a connection to a hosting environment without choosing any resources (see New-HostingResource)
    .PARAMETER Name
    Name of the hosting connection
    .PARAMETER ConnectionType
    Connection type can be VCenter, XenServer and SCVMM among several others
    .PARAMETER HypervisorAddress
    This contains the URL to the vCenter web API
    .PARAMETER HypervisorCredential
    A credentials object for authentication against the hypervisor
    .LINK
    New-HostingResource
    .EXAMPLE
    New-HostingConnection -Name vcenter-01 -ConnectionType VCenter -HypervisorAddress https://vcenter-01.example.com/sdk -HypervisorCredential (Get-Credential)
    #>
    [CmdletBinding()]
    param(
        [Parameter(Mandatory=$True,HelpMessage='Name of the hosting connection')]
        [ValidateNotNullOrEmpty()]
        [string]
        $Name
        ,
        [Parameter(Mandatory=$True,HelpMessage='Connection type can be VCenter, XenServer and SCVMM among several others')]
        [ValidateSet('VCenter','XenServer','SCVMM')]
        [string]
        $ConnectionType
        ,
        [Parameter(Mandatory=$True,HelpMessage='This contains the URL to the vCenter web API')]
        [ValidateNotNullOrEmpty()]
        [string]
        $HypervisorAddress
        ,
        [Parameter(Mandatory=$True,HelpMessage='A credentials object for authentication against the hypervisor')]
        [ValidateNotNullOrEmpty()]
        [pscredential]
        $HypervisorCredential
    )

    if (-Not (Test-Path -Path XDHyp:\Connections\$Name)) {
        $HostingConnection = New-Item -Path XDHyp:\Connections\$Name -ConnectionType $ConnectionType -HypervisorAddress $HypervisorAddress -HypervisorCredential $HypervisorCredential -Persist
    } else {
        $HostingConnection = Get-Item XDHyp:\Connections\$Name
    }
    $HypervisorConnectionUid = $HostingConnection.HypervisorConnectionUid | Select-Object -ExpandProperty Guid
    New-BrokerHypervisorConnection -HypHypervisorConnectionUid $HypervisorConnectionUid | Out-Null
}

#endregion Anlegen einer Hosting-Verbindung